import Layout from '../Components/Layout';

const Index = () => (
  <Layout>
    <div>
      <h1>Welcome to BitPrice </h1>
    </div>
  </Layout>
);
Index.getInitialProps =async function()
{
  const res = await fetch(`https://api.coindesk.com/v1/bpi/currentprice.json`);
}
export default Index;
